import React, { useState } from 'react'

function App() {

  const [inputValue, setInputValue] = useState('')
  const [items, setItems] = useState([])

  // const InputChange=(e)=>{setInputValue(e.target.value)}

  const addItem=()=>{

    if(inputValue!=''){
      setItems([...items,inputValue]);
    }
    console.log(items)
  }



  return (
    <>
      <div className="main">
        <div className="main1">
          <div className="main11">
            <h1 className="heading">Todo List</h1>
            <div className="inputBar">
              <input type="text" placeholder='Add Item' onChange={(e)=>{setInputValue(e.target.value)}} value={inputValue}/>
              <button className="btn" onClick={addItem}>+</button>
            </div>
            <div className="listItem">
              <div className="text">
                <h3>Buy new laptop</h3>
                <button className="delBtn">Del</button>
              </div>
            </div>
          </div>
        </div>
      </div>
    </>
  )
}

export default App
